	add("understanding", "{\"term\":\"understanding\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mental, sometimes emotional \u0027\u0027process\u0027\u0027 of comprehension, assimilation of knowledge, which is subjective by its nature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Reason or intelligence, \u0027\u0027ability\u0027\u0027 to grasp the full meaning of knowledge, ability to infer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Opinion, judgement or outlook\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21582495-computers-will-help-people-understand-brains-better-and-understanding-brains The machine of a new passage\u003dThe yawning gap in neuroscientists’ \u0027\u0027understanding\u0027\u0027 of their topic is in the intermediate scale of the brain’s anatomy. Science has a passable knowledge of how individual nerve cells, known as neurons, work. It also knows which visible lobes and ganglia of the brain do what. But how the neurons are organised in these lobes and ganglia remains obscure\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An informal contract, mutual agreement\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A reconciliation of differences\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Sympathy\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"All that people individually sense and feel of themselves\", \"priority\":8}]}, \"synonyms\":{}}");

