	add("underwear", "{\"term\":\"underwear\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"Dutch\", \"Swedish\"], \"text\":\"From {{prefix|under|wear|lang\u003den}}. Compare Dutch \u0027ondergoed\u0027 German \u0027unterwäsche\u0027 Swedish \u0027underkläder\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Clothes worn next to the skin, underneath outer clothing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Toni L. Meilleur, \u0027Tournament of Fire\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“A thong,” she answered him breathlessly. Now completely turned on by the fact that his man was sniffing her \u0027\u0027underwear\u0027\u0027 and grinning like a tiger that took down its prey. That is if tigers could smile and still look sexy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Underpants (boxers, briefs, panties, etc) and bras\", \"priority\":4}]}, \"synonyms\":{}}");

