	add("underwood", "{\"term\":\"underwood\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"The surname is sometimes habitational, used by someone who lived in any of several places of the same name. Otherwise it is topographic, referring to someone who lived near a wood. In both cases the name is from England or Scotland, and from Middle english (1100-1500) The common noun comes from the name of the manufacturer, after John T. Underwood, one of its founders.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A typewriter made by the w:Underwood Typewriter Underwood Typewriter Company\", \"priority\":1}]}, \"synonyms\":{}}");

