	add("undress", "{\"term\":\"undress\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|un|dress|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of having few or no clothes on\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Charles Dickens, \u0027Little Dorrit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The visitor, observing that she held the door on the inside, and that, when the uncle tried to open it, there was a sharp adjuration of \u0027Don\u0027t, stupid!\u0027 and an appearance of loose stocking and flannel, concluded that the young lady was in an \u0027\u0027undress\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A loose, negligent dress; ordinary dress, as distinguished from full dress\", \"priority\":4}]}, \"synonyms\":{}}");

